import React from 'react';

const LogEntryForm = () => {
  return (
    <form>
      <label for="title">Title</label>
      <input name="tile" />
      <label for="comments">Comments</label>
      <textarea name="comments" rows={3}></textarea>
      <label for="description">Description</label>
      <textarea name="comments" rows={3}></textarea>
    </form>
  )
};

export default LogEntryForm;
